import logo from './logo.svg';
import './App.css';
import { Route, Router, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className='container'>
      <Router>
        <Navbar/>
        <Routes>
          <Route path='/' element={<Navbar/>} />
      </Routes>
       </Router>
 </div>
  );
}

export default App;
